import React, { Component } from 'react';
import {Progress} from './progress'



export class AllProgress extends Component {
    state = { 
        progress: [
            {id:1, title: 'web dev'},
            {id:2, title: 'design'},
            {id:3, title: 'networking'}
        ]
     } 
    render() { 
        return (
            <Progress units={this.state.progress} />
        );
    }
}

//export default AllProgress;
